-- DROP TABLE valida_integridad_datos;

CREATE TABLE valida_integridad_datos (
	departamento_nombre varchar(128) NULL,
	divipola_municipio bpchar(5) NULL,
	municipio_nombre varchar(128) NULL,
	codigo_gestor int4 NULL,
	gestor_catastral varchar(512) NULL,
	registro_validacion_id int4 NULL,
	periodo_reporte_id int4 NULL,
	archivo varchar(100) NULL,
	validacion_descripcion varchar(256) NULL,
	num_registros_violan_validacion int4 NULL,
	fecha_ejecucion_validacion timestamp NULL,
	lote_validacion int4 NULL,
	validacion_obligatoria varchar(2) NULL,
	etapa_validacion varchar(100) NULL,
	texto_error_sistema text NULL,
	entrega varchar(8) NULL
);



